import React, {useEffect} from "react";
import {useNavigate} from "react-router-dom";

const Welcome = () => {
    useEffect(()=>{
        console.log("Welcome");
    },[]);
    let navigate = useNavigate();
    const Login = () => {
        navigate("/login");
    }
    const Registration = () => {
        navigate("/registration");
    }
    return(
        <div>
            <div className="jumbotron text-center">
                <h1>Welcome to NeighbourGen</h1>
                <p>Let's connect to your neighbours.</p> 
            </div>
            <div className="d-flex align-items-center">
            <span class="align-middle">
                <button className="btn btn-success btn-lg" onClick={Login}>Login</button>
                <button className="btn btn-primary btn-lg" onClick={Registration}>Register</button>
                </span>
            </div>  

        </div>
    )
}

export default Welcome;
